from typing import List

# Initial solution too slow
class Solution:
    def replaceElements(self, arr: List[int]) -> List[int]:
        for i, _ in enumerate(arr):
            if i == len(arr)-1:
                arr[i] = -1
            else:
                arr[i] = max(arr[i+1:])
        return arr

# Found this in solutions - starting at the end was the best option
class Solution2:
    def replaceElements(self, arr: List[int]) -> List[int]:
        n = len(arr)
        max_sofar = arr[-1] # start with the last element
        arr[-1] = -1
        # Greedily replace the current item with the maximum value sofar
        for i in range(n-2,-1,-1): # iterative from right to left
            cur = arr[i]
            arr[i] = max_sofar
            max_sofar = max(max_sofar, cur)
        return arr

